INSERT INTO `comments` (`id`, staff_id, `posts_id`, `body`, `created_at`, `updated_at`) VALUES (12,16,151,'Hot end was blocked - exchanged heater block and nozzle with a set from the acetone jar. Tested, fully working.','2017-08-23 12:40:16','2017-08-23 12:40:16'),(13,16,146,'Printer is working. Leaving ticket on system for now so IT can resolve issue with date stamping. Days out of order stated negative 70 as of 23.08.17.','2017-08-23 12:48:06','2017-08-23 12:48:06'),(14,16,146,'Printer had been fixed in the interim between entering into the old system and finding it on the new system. Logged by Daniel Wallace (as was the last update, although it says T. Medjnoun!)','2017-08-23 12:54:12','2017-08-23 12:54:12'),(15,16,147,'Printer fixed before today but not logged as such. Tested fully working','2017-08-23 12:58:37','2017-08-23 12:58:37'),(16,16,25,'Printer has been cannibalised for parts. Currently missing extruder assembly and one levelling screw','2017-08-23 13:00:27','2017-08-23 13:00:27'),(17,16,141,'Printer has been cannibalised for parts. No extruder assembly or bed.','2017-08-23 13:03:52','2017-08-23 13:03:52'),(18,16,25,'Printer no longer in cupboard','2017-08-30 11:10:06','2017-08-30 11:10:06'),(19,16,153,'Old screw removed, new one fitted','2017-08-30 13:55:53','2017-08-30 13:55:53'),(20,13,129,'Replaced extruder PCB and ribbon cable. White ribbon cable had 2 bent pins which were unbent.','2017-08-30 14:34:34','2017-08-30 14:34:34'),(21,13,156,'Working extruder assembly tested in printer including rainbow ribbon cable, did not fix issue. Therefore it is not the thermistor.','2017-10-10 10:32:16','2017-10-10 10:32:16'),(22,13,156,'White ribbon cable found marginally loose, removed and reconnected. On of the PCBs on the back slightly loose, reconnected.  Temp reading too hot and temp errors still.','2017-11-08 10:17:29','2017-11-08 10:17:29'),(23,13,149,'Layer shifting occurs, stabilised print head with zip ties. No visible mechanical block. Also filament jams a noticeable amount.','2017-11-08 10:26:01','2017-11-08 10:26:01'),(24,13,157,'Extruder head cleaned out and nozzle replaced with new one. Could print 3Dbenchy but quality was unacceptable. Jammed on a larger print afterwards.','2017-11-08 10:29:35','2017-11-08 10:29:35'),(25,13,118,'Buttons working,','2017-11-08 10:33:42','2017-11-08 10:33:42');
